INSERT INTO `tbl_user_feedbacks` VALUES (8,52,'This app is great!','2018-04-27 22:11:02',''),(13,89,'Cybtcrcybuctvubibu','2018-05-04 13:22:35','deleted'),(14,97,'Hello\n\nTest msg by Jeet','2018-05-07 19:29:01','deleted'),(15,68,'Loading takes way too load','2018-05-11 03:19:43',''),(16,119,'When clicking notification bell in top right it crashes app on iphone x','2018-05-11 22:18:11',''),(17,116,'Keeps crashing when I try to open my \nnotifications','2018-05-11 23:07:32',''),(18,117,'Whenever I go onto the notifications the app crashes.\nI have follower requests but I can’t seem to accept them or even access that bit. \nNo Versus found ( idk if you guys have that bit yet but sometimes it shows and then it goes so???????????)','2018-05-11 23:55:18',''),(19,116,'App keeps crashing when I try to access my notifications','2018-05-12 06:25:09',''),(20,117,'won’t let me watch/open a versus vid. discovery page still is a bit bipolar on when it wants to show and not show. great improvement in the recording but with the buttons and everything. notifications don’t glitch tf out anymore either','2018-05-15 03:15:23',''),(21,114,'Bugs needed to be fixed:\n-A bit of low audio in the camera\n-Lines under “views” & “ votes”\n-Certain profiles won’t load at times\n-Notifications used to close down in a split second after opening it up\n-On the discovery page, the “world” icon says date not found then loads after 10 seconds\n- When opening up a video from another user to watch, it takes like also a good 10 seconds to load.','2018-05-15 04:46:52',''),(22,68,'The generalization of this app seems to be working but there just seems to be a problem every time another is resolved. The top layout needs to be lowered away from the safe zone(Iphone time, data icons, battery life) and loading takes some time that people might not have the patience for. Some users have spoken about the app closing when in using camera, profiles, notifications. Profile pictures will be the same picture of someone even though the profiles are each different. Camera quality needs better improvement, sound needs to be clearer, response time should be asap when sending verses. Viewing other profiles should be easier','2018-05-15 09:07:50',''),(23,108,'Hi this app is awesome\nGreat application','2018-05-16 17:10:54',''),(24,123,'Every time I click on the little bell in top right hand corner the app closes.','2018-05-16 17:54:20',''),(25,86,'Bbbkn ggcbbbb','2018-05-17 12:36:37',''),(26,117,'still won’t let me open up my versus. app crashes when i see someone else’s versus too','2018-05-18 00:12:58',''),(27,193,'Hey this is a really good app. I\'m new to it but I don\'t know how to do basically anything? How do you vote because I\'ve been trying to.  I also have no idea how to search for people and the \"save/upload\" button on the camera doesn\'t work for me. \n\nDon\'t get me wrong, this is amazing but the formatting needs a small tweaking.','2018-06-10 15:13:45',''),(28,224,'bxbx','2018-10-15 19:04:20',''),(29,224,'ghh','2018-10-15 19:08:31',''),(30,224,'hdhd','2018-10-15 19:10:31',''),(31,224,'jf','2018-10-15 19:13:16',''),(32,224,'dfh','2018-10-15 19:16:33',''),(33,224,'x,bxn','2018-10-16 09:45:58',''),(34,224,'test from pawan jeet','2018-10-26 18:19:07',''),(35,52,'testing feedback on Android','2018-10-30 23:00:57',''),(36,98,'hello users','2018-11-15 16:56:10',''),(37,52,'feed back from Android','2018-11-15 23:00:19',''),(38,89,'test message from Jeet','2018-11-26 18:57:49',''),(39,196,'testing feedback from Android phone','2019-01-05 13:07:40','');
